import PropTypes from 'prop-types';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Navigation from "./Navigation/Navigation";
import NosavedPage from "./components/Saved/NotSaved";


function App({ children }) {
  return (
    <Router>
      <Navigation />
      <div className="min-h-screen w-full flex flex-col justify-between bg-primary">
        <Switch>
          <Route path="/app" exact component={MainPage} />
          <Route path="/app/templates" component={TemplatesPage} />
          <Route path="/app/analysis" component={AnalysisPage} />
          <Route path="/app/nosaved" component={NosavedPage} /> {/* Новий маршрут */}
          {/* Додайте інші маршрути за необхідністю */}
        </Switch>
        {children}
      </div>
    </Router>
  );
}

App.propTypes = {
  children: PropTypes.node.isRequired,
};

export default App;
